import styled from 'styled-components';

export const NavbarContainer = styled.nav`
    background: ${({scrollNav}) => (scrollNav ? '#000' : '#191919')};
    height: 80px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 1.2rem;
`
